import React from "react";
import '../styles/navbar' 
 const NavbaR =()=>{
return(
    <div className="navbar-links">
          <a href="/home">Home</a>
          <a href="/profile">Profile</a>
          <button >Logout</button>
          <a href="/doner">Doner's</a>
        </div>
)
 }

 export default NavbaR
